import { Fragment } from 'react';
import { BrowserRouter, Navigate, Route, Routes } from 'react-router-dom';
import { ToastContainer } from 'react-toastify';
import './App.css';
import FullScreenLoader from './Components/Layout/FullScreenLoader';
import CanceledPage from './Pages/CanceledPage';
import CompletedPage from './Pages/CompletedPage';
import CreateTaskPage from './Pages/CreateTaskPage';
import DashboardPage from './Pages/DashboardPage';
import ForgetPassPage from './Pages/ForgetPassPage';
import InprogressPage from './Pages/InprogressPage';
import LoginPage from './Pages/LoginPage';
import NewTaskPage from './Pages/NewTaskPage';
import RegisterPage from './Pages/RegisterPage';
import SettingPage from './Pages/SettingPage';
import NotFoundPage from './Pages/SettingPage';

function App() {
  if('token'){
    return <Fragment>
    <BrowserRouter>
         <Routes>


      <Route path='/' element={<Navigate to='dashboard' element={<DashboardPage/>}/>} />
      <Route path='/login' element={<LoginPage/>} />
      <Route path='/register' element={<RegisterPage/>} />
      <Route path='/forgetpass' element={<ForgetPassPage/>} />
     <Route path='/dashboard' element={<DashboardPage/>} />
     <Route path='/newTask' element={<NewTaskPage/>}/>
     <Route path='/createTask' element={<CreateTaskPage/>}/>
     <Route path='/inprogress' element={<InprogressPage/>}/>
     <Route path='/completed' element={<CompletedPage/>}/>
     <Route path='/canceled' element={<CanceledPage/>}/>
     <Route path='/setting' element={<SettingPage/>}/>
     <Route path='*' element={<NotFoundPage/>}/>

    </Routes>
    </BrowserRouter>
    <ToastContainer />
    <FullScreenLoader/>
  </Fragment>;
  }else{
    return <Fragment>
    <BrowserRouter>
         <Routes>


      <Route path='/' element={<Navigate to='login' element={<LoginPage/>}/>} />
      <Route path='/register' element={<RegisterPage/>} />

    </Routes>
    </BrowserRouter>
    <ToastContainer />
    <FullScreenLoader/>
  </Fragment>;
  }

}

export default App;
